const Card = (props) => {
  return (
    <div className="">
        <button onClick={props.onClose}>X</button>
        <h3>Nombre: {props.name}</h3>
        <p>Estatus: {props.status}</p>
        <p>Especie: {props.species}</p>
        <p>Genero: {props.gender}</p>
        <p>Origen: {props.origin}</p>
        <img src={props.image} alt={props.name} />
    </div>
  );
}

export default Card;
